import axios from 'axios';

function checkAuth(navigate) {
    axios.get('http://localhost:3001/check', { withCredentials: true })
      .then(res => {
        if (!res.data.Status === "Success") {
          navigate("/");
        }
      })
}

export default checkAuth;
